INSERT INTO `v1_ffe283dea8353559267cc5cbcbddd076a0a123ae188683beab33317baeb3222c` VALUES (1, 11, 10, 0, 0, 1, 82, 82017, 1, 0, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……");
INSERT INTO `v1_ffe283dea8353559267cc5cbcbddd076a0a123ae188683beab33317baeb3222c` VALUES ("", 91, 0, "", "", 0, 82, 82018, 0, "", "");
