INSERT INTO `v1_ffe283dea8353559267cc5cbcbddd076a0a123ae188683beab33317baeb3222c` VALUES (1, 11, 10, 0, 0, 1, 82, 82021, 1, 0, "それでも……適性など踏み越えて、\n己の道を突き進むのが冒険者です。\n一度決めたことを、\n曲げるわけには参りません……！");
